import React, { useState } from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import { Button } from "@mui/material";

const AddUser = () => {
  const [state, setState] = useState({
    name: "",
    email: "",
    contact: "",
    address: "",
  });
  const { name, email, contact, address } = state;
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <h3>Add user </h3>
      <Box
        component="form"
        sx={{
          "& > :not(style)": { m: 1, width: "25ch" },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField
          id="standard-basic"
          label="name"
          variant="standard"
          value={name}
          type="text"
        />
        <br />
        <TextField
          id="standard-basic"
          label="email"
          variant="standard"
          value={email}
          type="email"
        />
        <br />
        <TextField
          id="standard-basic"
          label="contact"
          variant="standard"
          value={contact}
          type="number"
        />
        <br />

        <TextField
          id="standard-basic"
          label="address"
          variant="standard"
          value={address}
          type="text"
        />
        <Button variant="contained" color="primary" type="submit">
          Submit
        </Button>
      </Box>
    </div>
  );
};

export default AddUser;
